import mole from "./Mole";

class List {
    // 행, 열 드롭다운 리스트
    rowColumn: {value: number, label: number}[] = [
        {value: 2, label: 2},
        {value: 3, label: 3},
        {value: 4, label: 4},
        {value: 5, label: 5},
        {value: 6, label: 6},
    ]
    // 두더지 수 드롭다운 리스트
    count() {
        const list: {value: number, label: number}[] = [];
        // 최소 1, 최대 (행 x 열) / 2
        for (let i=1; i<mole.utils.availableCount(); i++) {
            list.push({value: i, label: i})
        }

        return list;
    }
}

export default new List();
